task.spawn(function()
    local function GetService(name)
        local svc = game:GetService(name)
        return cloneref and cloneref(svc) or svc
    end

    local Workspace = GetService("Workspace")
    
    local SafeZones = Workspace:WaitForChild("IncludeToGame", 10)
    if SafeZones then SafeZones = SafeZones:WaitForChild("SafeZones", 10) end
    if not SafeZones then return end

    local function PatchPart(part)
        if not part:IsA("BasePart") then return end
        
        if part.CanCollide ~= false then
            part.CanCollide = false
        end
        
        part:GetPropertyChangedSignal("CanCollide"):Connect(function()
            if part.CanCollide == true then
                part.CanCollide = false
            end
        end)
    end

    for _, v in ipairs(SafeZones:GetChildren()) do
        PatchPart(v)
        for _, child in ipairs(v:GetChildren()) do
            PatchPart(child)
        end
    end

    SafeZones.ChildAdded:Connect(function(child)
        PatchPart(child)
        child.ChildAdded:Connect(PatchPart)
    end)
end)
